import React from 'react';
import './App.css';

import { ModeContext } from './ModeContext';
import { Bar } from './Bar';
import { Chart } from './Chart';

function App() {
  return (
    <ModeContext>
      <div id='wrapper'>
        <div id='backdropA' />
        <div id='backdropB' />
        <div>
          <Bar />
          <Chart />
        </div>
        <div>
          <Bar />
          <Chart />
        </div>
      </div>
    </ModeContext>
  );
}

export default App;
